(window.webpackJsonp=window.webpackJsonp||[]).push([[1261],{1616:function(n,h,i){"use strict";i.r(h);var t=i(44),g=Object(t.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-2106-cuu-thien-thap-đe"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-2106-cuu-thien-thap-đe"}},[n._v("#")]),n._v(" Chương 2106: Cửu Thiên Thập Đế")]),n._v(" "),i("hr"),n._v(" "),i("p",[n._v("“Nguyên lai là Dương Huyền tiền bối, ngưỡng mộ đại danh đã lâu!” Chần chờ một chút, Mặc Nguyên vội vàng ôm quyền."),i("br"),i("br"),n._v("“Ngưỡng mộ đã lâu cái gì? Trước ngươi nghe qua tên của ta? Biết ta là người nào?”"),i("br"),i("br"),n._v("Lắc đầu, Trương Huyền khẽ nói."),i("br"),i("br"),n._v("Danh sư đại lục dùng tên giả, tuỳ ý mang lên đến, cũng gọi ngưỡng mộ đã lâu... Xem ra là Thần giới người, cũng đồng dạng không có như vậy thành thật."),i("br"),i("br"),n._v("“Cái này...” Mặc Nguyên lão sư hơi đỏ mặt."),i("br"),i("br"),n._v("Cái gọi là ngưỡng mộ đã lâu, chỉ là lời khách khí mà thôi, đối mặt người khác nói thẳng không biết, thất lễ dường nào?"),i("br"),i("br"),n._v("Kết quả đối phương hỏi như vậy, ngược lại làm cho hắn không biết trả lời như thế nào."),i("br"),i("br"),n._v("“Được rồi, cùng các ngươi viện trưởng quen biết, cũng không cần khách khí với ta! Ta cũng sẽ không làm khó hậu bối. Ngược lại là, vừa vặn có chút việc, khả năng cần làm phiền các ngươi một cái!” Trương Huyền nói."),i("br"),i("br"),n._v("“Tiền bối có chuyện cứ nói đừng ngại, chỉ cần ta có thể làm được, nhất định sẽ không từ chối.” Thấy đối phương không hỏi tới nữa, Mặc Nguyên lão sư thở phào nhẹ nhõm."),i("br"),i("br"),n._v("“Học sinh của ta, ở đây thí luyện, bởi vì chưa hề đi ra qua, có chút lạc đường, làm lão sư, không tiện trực tiếp ra mặt nói cho, hơn nữa, ta còn có việc gấp muốn đi xử lý, mong rằng ngươi có thể thích hợp nhắc nhở một chút, như có khả năng, đem bọn hắn mang về Dạ Minh thành!”"),i("br"),i("br"),n._v("Trương Huyền nhàn nhạt nhìn qua à: “Đương nhiên, ta sẽ không để cho ngươi không công hỗ trợ! Sẽ đem ngươi hiện nay trong tu luyện vấn đề, nói rõ chi tiết một lần, còn, có thể hay không tiến hành sửa lại, có thể hay không tìm tới thích hợp hơn con đường của chính mình, liền xem chính ngươi thiên phú cùng năng lực!”"),i("br"),i("br"),n._v("“Đa tạ tiền bối!” Mặc Nguyên lão sư kích động vội vàng ôm quyền."),i("br"),i("br"),n._v("Người sở dĩ khó mà tiến bộ, chính là bởi vì không tự biết!"),i("br"),i("br"),n._v("Nếu có người ở một bên chỉ điểm, thậm chí không cần nói cho phương pháp chính xác, đều vô cùng có khả năng cấp tốc tiến bộ."),i("br"),i("br"),n._v("Trước mắt vị này, có thể giúp đỡ chỉ ra, tuyệt đối là rất đại ân tình."),i("br"),i("br"),n._v("Còn... Mang đối phương học sinh trở lại Dạ Minh thành, vô cùng đơn giản, dù sao lần này học sinh thí luyện kết thúc, hắn cũng muốn mang đám người trở về."),i("br"),i("br"),n._v("Nếu có thể nhân cơ hội làm tốt cùng hắn học sinh quan hệ, loại này cường giả nhân tình chẳng khác nào rơi xuống!"),i("br"),i("br"),n._v("“Vậy là tốt rồi, các ngươi ở đây chờ đợi là được, ta sẽ để cho bọn họ đến tìm ngươi!” Thấy đối phương đáp ứng, Trương Huyền gật gật đầu, xoay người sang chỗ khác, đột nhiên, khí tức trên thân, bay thẳng Thiên cung, cho người ta một loại, nghiền ép chúng sinh cảm giác."),i("br"),i("br"),n._v("“Tiền bối...” Không biết đối phương vì sao đột nhiên lật lọng, Mặc Nguyên lão sư giật nảy mình, vội vàng nhìn qua."),i("br"),i("br"),n._v("“Đã đáp ứng ta sự tình, liền muốn làm tốt, nếu như ta sự tình xử lý xong, phát hiện được ta học sinh thiếu một cái lông tơ... Kết quả làm sao, chắc hẳn ngươi cũng rõ ràng!”"),i("br"),i("br"),n._v("Đưa lưng về phía đám người, Trương Huyền thản nhiên nói."),i("br"),i("br"),n._v("“Tiền bối yên tâm, tại hạ nhất định dốc hết toàn lực, không phụ hi vọng!” Thở phào nhẹ nhõm, Mặc Nguyên lão sư sắc mặt nghiêm túc."),i("br"),i("br"),n._v("“Ngươi trong tu luyện vấn đề, ta sẽ để học sinh lấy cho ngươi tới!”"),i("br"),i("br"),n._v("Thấy đối phương đáp ứng, không nói thêm lời, Trương Huyền chậm rãi rời khỏi, chỉ chốc lát biến mất ở trong sơn cốc."),i("br"),i("br"),n._v("Thấy hắn rời khỏi, Mặc Nguyên lão sư lúc này mới xoa xoa mồ hôi lạnh trên đầu."),i("br"),i("br"),n._v("  Vừa rồi đối phương toả ra khí tức, thực sự thật là đáng sợ, mười cái hắn cũng hoàn toàn không phải đối thủ."),i("br"),i("br"),n._v("May mắn trước đó không có lỗ mãng, nếu không, nơi này khả năng chính là hắn cùng rất nhiều học sinh nơi táng thân."),i("br"),i("br"),n._v("“Lão sư, vị kia... Dương Huyền tiền bối, thật lợi hại như vậy?”"),i("br"),i("br"),n._v("Vừa rồi vị kia rất có tư sắc nữ hài nhìn lại."),i("br"),i("br"),n._v("Nàng đại tiểu thư tính tình, có chút không quá tin tưởng."),i("br"),i("br"),n._v("“Nào chỉ là kịch liệt, có thể nói là đáng sợ!” Mặc Nguyên lão sư lắc đầu: “Được rồi, nắm chặt thời gian chuẩn bị ăn, nghỉ ngơi thật tốt, ngày mai trời vừa sáng, chúng ta trực tiếp trở về địa điểm xuất phát!”"),i("br"),i("br"),n._v("“Trực tiếp trở về địa điểm xuất phát? Lập tức tới ngay thí luyện địa phương...” Thiếu nữ sững sờ."),i("br"),i("br"),n._v("Lập tức liền muốn tới thí luyện địa phương, bây giờ đi về, chẳng phải công lao đổ biển?"),i("br"),i("br"),n._v("“Vốn ta đi theo các ngươi sau lưng bảo vệ, hiện tại xuất hiện, cũng đã cho thấy thí luyện thất bại! Có điều, các ngươi có thể đi tới nơi này, đã rất không dễ dàng, ta sẽ như thực chất báo lên học viện, học phần hẳn là sẽ có, không cần lo lắng!”"),i("br"),i("br"),n._v("Trầm tư một chút, Mặc Nguyên lão sư nói."),i("br"),i("br"),n._v("Thí luyện khẳng định có nguy hiểm, nếu như vị tiền bối nào học sinh tới, thật xảy ra vấn đề gì, tuyệt đối không phải hắn một cái nho nhỏ lão sư có thể gánh chịu."),i("br"),i("br"),n._v("Đã như vậy, còn không bằng, trở về được rồi."),i("br"),i("br"),n._v("“Đa tạ lão sư...” Nghe được có học phần, đám người đồng loạt thở phào nhẹ nhõm."),i("br"),i("br"),n._v("Thí luyện mục đích, chính là vì học phần, có thứ này, lại có thể miễn trừ nguy hiểm, sao lại không làm."),i("br"),i("br"),n._v("Đám người nhóm lửa nấu cơm, các loại bận rộn, thời gian không dài, liền nghe đến trong sơn cốc vang lên lần nữa sột soạt âm thanh, ngay sau đó một đám người đi tới."),i("br"),i("br"),n._v("“Là Mặc Nguyên lão sư ư? Tại hạ Trương Huyền, chính là Dương Huyền lão sư học sinh, nghe lão sư nói, ngươi cùng hắn quen biết, cố ý tới...”"),i("br"),i("br"),n._v("Kèm theo lời nói, một cái cao gầy anh tuấn thân ảnh đi tới, Trương Huyền mang theo vui vẻ, sau lưng Triệu Nhã đám người đi sát đằng sau."),i("br"),i("br"),n._v("“Nguyên lai là Trương Huyền tiểu huynh đệ, mời tới bên này...” Mặc Nguyên lão sư vội vàng ôm quyền, đồng thời lặng lẽ nhìn về phía trước mắt đám người, nhịn không được lộ ra nghi hoặc."),i("br"),i("br"),n._v("Vị này Dương Huyền tiền bối những học sinh này, tu vi... Tựa hồ cũng có chút thấp ah!"),i("br"),n._v("Khó trách để cho mình hỗ trợ mang đi ra ngoài, loại thực lực này, có thể tại đây loại khắp nơi nguy hiểm thâm sơn đi tới nơi này, thật đúng là kỳ tích."),i("br"),i("br"),n._v("Hắn tràn đầy kinh ngạc, sau lưng cái kia rất có tư sắc nữ hài, nhìn thấy một cái toát ra mấy vị so với nàng xinh đẹp không biết gấp bao nhiêu lần nữ hài, vẻ mặt một cái trở nên hết sức khó coi."),i("br"),i("br"),n._v("Còn thiếu niên khác, thì từng cái con mắt sáng lên."),i("br"),i("br"),n._v("Mỹ nữ, bất luận tại bất cứ lúc nào, đều khá là được hoan nghênh."),i("br"),i("br"),n._v("“Chư vị, chúng ta nơi này có ăn, mau tới cùng một chỗ...” Thiếu niên áo trắng vội vàng đi vào trước mặt."),i("br"),i("br"),n._v("“Cám ơn!” Triệu Nhã đám người gật gật đầu nhìn về phía Trương Huyền, thấy hắn đồng ý, lúc này mới ngồi xuống."),i("br"),i("br"),n._v("Một mực trốn ở sơn động hơn mười ngày, lần đầu tiên đi ra, cảm giác toàn thân nhẹ nhõm."),i("br"),i("br"),n._v("“Mặc Nguyên lão sư, đây là ngươi trong tu luyện một bộ phận thiếu hụt, lão sư nói, ngươi trước dựa theo sửa chữa, đợi hắn lần sau gặp ngươi, sẽ đem nội dung bổ sung hoàn chỉnh!” Từ trong ngực lấy ra một mảnh lá cây, Trương Huyền đưa tới."),i("br"),i("br"),n._v("Chỉ thấy phía trên, dùng màu đen chất lỏng, viết một chút trên việc tu luyện nội dung."),i("br"),i("br"),n._v("Mặc Nguyên lão sư xem xong, đồng tử co rút lại."),i("br"),i("br"),n._v("Vị này Dương Huyền lão sư, đưa cho cùng nội dung, so với hắn tưởng tượng còn muốn tỉ mỉ không ít, dựa theo phía trên ghi lại thiếu hụt thay đổi, có thể đoán được, thân thể của hắn bên trên tai hoạ ngầm, có thể toàn bộ loại bỏ, tu vi cũng đem càng ngày càng mạnh."),i("br"),i("br"),n._v("“Đa tạ Dương lão sư!” Mặc Nguyên lão sư ôm quyền."),i("br"),i("br"),n._v("Đối phương tuy là chỉ cho một nửa nội dung, hắn cũng biết mưu đồ, là sợ bản thân không tận lực."),i("br"),i("br"),n._v("Đối mặt loại tình huống này, trong lòng chẳng những không có oán hận, ngược lại cảm giác yên tâm không ít."),i("br"),i("br"),n._v("Có thể vì học sinh, như vậy tận tâm, khẳng định không phải kẻ xấu."),i("br"),i("br"),n._v("Đối phương lần luyện tập này, mang theo không ít đồ ăn, lại thêm Mặc Nguyên lão sư có thực lực săn giết thần thú, Trương Huyền cùng mình rất nhiều học sinh, Tôn Cường đám người, mới coi như ăn được đi vào Thần giới bữa cơm thứ nhất đồ ăn."),i("br"),i("br"),n._v("Viên Đào mở rộng cái bụng, kém chút không ăn đám người nghi ngờ nhân sinh."),i("br"),i("br"),n._v("Đương nhiên, may mắn tiểu hoàng kê không có tỉnh lại, nếu không, cũng không phải là nghi ngờ nhân sinh đơn giản như vậy, đoán chừng, liền vũ khí cũng bị mất."),i("br"),i("br"),n._v("Tuổi tác tương đương, lại tại loại này khiến cho người tâm thần thanh thản dã ngoại, chủ đề tự nhiên nhiều hơn."),i("br"),i("br"),n._v("Trịnh Dương đám người có Trương Huyền dặn dò, biết cái gì có thể nói, cái gì không thể nói, trò chuyện hồi lâu, cũng không dẫn tới nghi hoặc."),i("br"),i("br"),n._v("“Các ngươi một mực hỏi thăm, Thần giới bố cục, vừa vặn ngày hôm nay những người bạn này cũng tại, ta liền cùng các ngươi nói rõ chi tiết một cái!”"),i("br"),i("br"),n._v("Cơm nước no đủ, đám người chồng chất ngồi thành một vòng, Mặc Nguyên lão sư mỉm cười, mở miệng nói."),i("br"),i("br"),n._v("Toàn bộ Thần giới, rộng lớn bao la bát ngát, không biết cỡ nào rộng lớn, bọn họ vị trí Dạ Minh thành, chỉ là trong đó không thấy được một cái địa phương nhỏ mà thôi, bởi vậy, cho dù đến đây thí luyện những học sinh này, từng cái gia thế không đơn giản, đối toàn bộ Thần giới bố cục, cũng biết không tính quá nhiều."),i("br"),i("br"),n._v("Trương Huyền nhìn lại."),i("br"),i("br"),n._v("Đối phương sở dĩ lúc này nói, đương nhiên là hắn dẫn ra chủ đề."),i("br"),i("br"),n._v("“Thần giới, chia làm chín đại thế lực, cũng được xưng là Cửu Thiên!” Mặc Nguyên lão sư nói."),i("br"),i("br"),n._v("“Ta biết, có phải hay không cũng chính là trong truyền thuyết Cửu Thiên Cửu Đế?” Thiếu niên áo trắng dường như vì khoe khoang, vội vàng nói."),i("br"),i("br"),n._v("Nhìn hắn bộ dáng này, rất có tư sắc nữ tử, càng là giận không chỗ phát tiết."),i("br"),i("br"),n._v("“Không sai, Cửu Thiên Cửu Đế!” Mặc Nguyên lão sư gật gật đầu: “Cái này Cửu Thiên, theo thứ tự là: Trung tâm Tự Tại thiên, phía đông Vân Ly thiên, phía nam Linh Nguyên thiên, phương tây canh Kim Thiên, phương bắc Huyền Minh thiên, đông nam Liệt Dương thiên, đông bắc Kiếm Thần thiên, tây nam Linh Lung thiên cùng với chúng ta chỗ tây bắc U Hồn thiên!”"),i("br"),i("br"),n._v("“Cửu Thiên, chín đại thế lực, phân biệt từ chín vị Đại Đế tọa trấn! Mỗi một cái đều nắm giữ lực lượng hủy thiên diệt địa, khống chế một phương quyền thế, bễ nghễ thiên hạ, người người ngưỡng mộ!”"),i("br"),i("br"),n._v("Mặc Nguyên lão sư ánh mắt lộ ra vẻ sùng bái."),i("br"),i("br"),n._v("Cửu Đế, khống chế thiên hạ, cùng Thượng Thương sáu đại tông môn tông chủ đồng dạng, chân chính đứng ở thế giới chi đỉnh, quả thực làm người ta kính nể."),i("br"),i("br"),n._v("“Lão sư, nghe nói mới xuất hiện một vị ngút trời Đại Đế, cái thế vô song... Hiện tại đã là Cửu Thiên Thập Đế!” Một cái hiểu rõ tình hình học sinh, nói."),i("br"),i("br"),n._v("“Không sai, là xuất hiện một vị ngút trời Đại Đế!”"),i("br"),i("br"),n._v("Mặc Nguyên lão sư gật đầu: “Nói đến vị này Đại Đế, thật đúng là thiên tài trong thiên tài, từ nổi danh bắt đầu, ngắn ngủi thời gian mấy năm, giống như sao băng chiếu rọi Thần giới, ép tám vị Đại Đế, thừa nhận thân phận của mình, hiện tại cũng liền Tự Tại thiên vị kia Đế Quân, không có thừa nhận, chỉ cần có thể công nhận, Thần giới thế lực, sợ rằng sẽ sẽ lần nữa phân chia...”"),i("br"),i("br"),n._v("“Cửu Thiên Thập Đế?” Trương Huyền gật gật đầu, vô tình hay cố ý cảm xúc: “Đế Quân loại này cấp bậc, cách chúng ta thực sự quá xa vời, ở giữa không biết kém bao nhiêu cấp bậc...”"),i("br"),i("br"),n._v("Lời còn chưa dứt, trong đám người một người học sinh khác, tràn đầy tò mò nhìn qua: “Lão sư, Đế Quân rốt cuộc mạnh cỡ nào? Ta nghe nói, có thể một ngón tay nghiền nát một tòa thành thị, có phải thật vậy hay không?”"),i("br"),i("br"),n._v("“Đương nhiên là thật...”"),i("br"),i("br"),n._v("Mặc Nguyên lão sư gật gật đầu, nói: “Các ngươi tu vi hiện tại, là hạ phẩm Thần Linh, ta là trung phẩm Thần Linh, viện trưởng thì là thượng phẩm Thần Linh! Điểm ấy các ngươi đã sớm biết đi!”"),i("br"),i("br"),n._v("Đám người lên tiếng."),i("br"),i("br"),n._v("“Thần Linh phía trên, là Thiên Thần! Đồng dạng chia làm hạ phẩm, trung phẩm thượng phẩm! Tiếp đó... Là Thần Vương, Thần Vương không phân cao thấp phẩm, nhưng lại có phổ thông Thần Vương cùng phong hào Thần Vương khác nhau, đi đến phong hào cấp bậc, mỗi một cái đều đứng tại thế giới chi đỉnh, cho dù chúng ta U Hồn thiên, cũng hầu như tổng không cao hơn mười vị!”"),i("br"),i("br"),n._v("Mặc Nguyên lão sư tiếp tục nói: “Phong hào Thần Vương phía trên, mới là Đế Quân... Bọn họ là thiên địa công nhận siêu cấp cường giả, số lượng là trời sinh, không có khả năng nhiều ra đến, thật muốn suy nghĩ nhiều... Nhất định phải để mặt khác Đế Quân thừa nhận! Tương đương với khiêu chiến đã định quy tắc, đây cũng là ngút trời Đại Đế vì sao muốn lần lượt khiêu chiến mặt khác Đại Đế nguyên nhân.”"),i("br"),i("br"),n._v("Người đăng: ThấtDạ"),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-2119"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-2121"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);